        text:
          '0': Hello there friend, welcome to the beautiful city of Cyrennica.
          '1': This is the capital of Andalucia, beyond its walls I can not promise you safety.
          '2': Beyond there is a bank you can go to store your treasures.
          '3': I'ld love to help, what do you need?
          '4': I am a city guide, here for your assistance.
          '5': There are many chests across the lands of Andalucia, within them you can find many treasures.
          '6': That star you have is your realm portal rune! You must be a foreigner.
          '7': We use Gems to trade with here in Cyrennica, you can also withdraw Gem Notes from the bank.
          '8': You can use your Character Journal to create a Personal Shop.
          '9': This city is beautiful. I suggest you go and explore it!
          '10': This fountain was built in commemoration to our great Kings of the past.
          '11': I love the smell of Dawns bakery in the morning.
          '12': There are some fantastic gardens over by the Arena.
          '13': You can duel people in the city, but take it to the Arena please.
          '14': The clamour and shouting of the market, I absolutely love it.
          '15': There is so much character and beauty in this city, I can never leave its walls.
          '16': You seem like the adventurer kind. Preparing for your next journey?
          '17': add
          '18': I can smell the sea here, it's even better at the docks, the smell of fish and the sound of seagulls
          '19': Heard about the new Merchant?
          '20': You can break down your armour and buy rare items at the merchant.
