        text:
          '0': Aha! Brother, do you need assistance?
          '1': I am but a lowly guard, but I hope to serve.
          '2': May your blade swipe deep and true.
          '3': Make sure you follow the laws around here.
          '4': Trouble brews outside the borders of the city. Trolls multiply in the DarkOak Forest.
          '5': Bandits are getting stronger and more organised, there are many of them in the Plains of Cyrene.
          '6': I wish I was out there fighting Gorgaths evil minions!
          '7': Be careful, the Skeletons are smart and fast.
          '8': I've killed many Skeletons and Zombies in my time, even a Whither Skeleton!
          '9': Iron Golems used to be our protectors... I don't know what happened.
          '10': I'm a guard! At your service!
          '11': Follow the rules, or you'll have to face me.
          '12': Im edging to go sword training at the barracks!
          '13': Curse Iridan!
          '14': May God bless our great King Bulwark.
          '15': I miss the wisps..
          '16': None can stand against the soldiers of our tribe!
          '17': Only five of the original twelve tribes exist.
          '18': I am glad Sunstrider defeated Gorgath, but I mourn his loss.
          '19': Left, right, left, right...
